import React, { FC, PropsWithChildren } from 'react';
import Link from 'next/link';
import { Col, Input, Menu, MenuProps, Row } from 'antd';

const items: MenuProps['items'] = [
  {
    type: 'group',
    label: (
      <Link href={'/'}>
        <a>Home</a>
      </Link>
    ),
  },
  {
    type: 'group',
    label: (
      <Link href={'/profile'}>
        <a>Profile</a>
      </Link>
    ),
  },
  {
    type: 'group',
    label: <Input.Search style={{ verticalAlign: 'middle' }} />,
  },
  {
    type: 'group',
    label: (
      <Link href={'/signup'}>
        <a>Signup</a>
      </Link>
    ),
  },
];

export const AppLayout: FC<PropsWithChildren> = ({ children }) => {
  return (
    <div>
      <Menu
        mode='horizontal'
        items={items}
      />
      <Row gutter={8}>
        <Col
          xs={24}
          md={6}>
          left
        </Col>
        <Col
          xs={24}
          md={12}>
          {children}
        </Col>
        <Col
          xs={24}
          md={6}>
          right
        </Col>
      </Row>
    </div>
  );
};
